window.bookSummaryJSON = "<p><b>After a disaster of a first heat, I’m ready to swear off alphas and escape to a cabin in the woods.</b></p> <p>My body has other plans.</p> <p>Now that I’m awakened, I can’t survive another heat alone.</p> <p>Problem is, I hate alphas, hate packs, and really super hate the so-called mates I can’t forgive and can’t forget.</p> <p>Now my biological clock’s ticking too fast to handle, and I can’t wait on Wyvern Pack to figure out their damage.</p> <p>I’ll take care of my own needs.</p> <p>And if you can’t give me what I want, then get out of my way.</p> <p>Because this omega bites back.</p> <p>This book contains frequent cursing, references to assault that may be disturbing, and a few alphaholes who need to grovel for redemption. It's a medium-burn romance with high heat that includes MM and MMFMMM scenes. </p>"; 
